import { useState } from "react";
import'../styles/Celebs.css'
const Celebs = () => {
    //database
    let stars=[
        {
        img:"Images/chishemsworth.jpg",
        name:"chishemsworth",
        id:1
        },
        {
        img:"Images/evans.jpg",
        name:"evans",
        id:2
        },
        {
        img:"Images/jonnydepp.jpg",
         name:"jonnydepp",
         id:3
         },
        {
        img:"Images/michaelscott.jpg",
        name:"michaelscott",
        id:4
          },
        {
        img:"Images/tomcruise.jpg",
        name:"tomcruise",
        id:5
        }
    ]
    let [starData,setData]=useState(setData)
    return ( 
        <div className="celebs">
            {starData.map(data=>(
                <div className="celebs_list">
                    <div className="imgage">
                    <img src={data.img} alt="" />
                    </div>
                    <div className="info">
                    <h1>{data.h1}</h1>
                </div>
                </div>
            ))}
        </div>
     );
}
 
export default Celebs;
